        private ScreenDumper _screenDumper;
        private Mock<IUiAutomatorServer> _uiAutomatorServerMock;

        [SetUp]
        public void SetUp()
        {
            _uiAutomatorServerMock = new Mock<IUiAutomatorServer>();
            _screenDumper = new ScreenDumper(_uiAutomatorServerMock.Object, 1);
        }

        [Test]
        public void ScreenDumper_WhenDumpingUi_ShouldReturnXDocument()
        {
            var xml = "<test>hej</test>";
            _uiAutomatorServerMock.Setup(u => u.Alive(2)).Returns(true);
            _uiAutomatorServerMock.Setup(u => u.DumpUi()).Returns(xml);
            var result = _screenDumper.DumpUi();
            Assert.AreEqual("test", result.Root.Name.LocalName);
            Assert.AreEqual("hej", result.Root.Value);           
        }
    }
